import { Component } from '@angular/core';

@Component({
  selector: 'app-claims-list',
  template: `
    <div class="claims-container">
      <h1>Claims Management</h1>
      <p>Claims list and management will be implemented here</p>
    </div>
  `,
  styles: [`
    .claims-container {
      padding: 24px;
    }
  `]
})
export class ClaimsListComponent { }
